import { Row, Col, Container } from 'react-bootstrap';
import ProjectCard from './ProjectCard';

const Project = () => {
	const project = [
		{
			title: 'Tech Blog',
			img: 'https://user-images.githubusercontent.com/84214872/131430156-7dbf9d59-cff6-41e8-bab1-0675d560e25b.png',
			description: 'Social Platform - Create and share blog posts.',
			url: 'https://tech-blog-cms.herokuapp.com/',
		},
		{
			title: 'PrayerPal',
			img: 'https://user-images.githubusercontent.com/84214872/139641887-3ccb90ae-68fa-44a3-9434-19e1fe972384.png',
			description: 'An application to bring you closer to god',
			url: 'https://prayer-pal.herokuapp.com/login',
		},
	];

	const styles = {
		heading: {
			fontSize: '4rem',
			textAlign: 'center',
		},
	};

	return (
		<>
		  <h2 style={styles.heading}>Projects</h2>
		  <Container>
			<Row>
			  {project.map((item, index) => ( // Change 'projectWork' to 'project' here
				<Col lg={4} key={index} className='d-flex mx-auto'>
				  <ProjectCard
					title={item.title}
					img={item.img}
					description={item.description}
					url={item.url}
				  ></ProjectCard>
				</Col>
			  ))}
			</Row>
		  </Container>
		</>
	  );
	  
};

export default Project;
